import { withInstall } from "../utils/index.mjs";
import _NumberKeyboard from "./NumberKeyboard.mjs";
const NumberKeyboard = withInstall(_NumberKeyboard);
var stdin_default = NumberKeyboard;
export {
  NumberKeyboard,
  stdin_default as default
};
